  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Flint Hills National
  Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar year. The
  report begins with an introduction to the Refuge and information about weather conditions.
  Te planning section discusses public participation. Administration topics are covered,
  including personnel, youth programs, volunteer programs, funding, safety, and technical
  assistance. Habitat management is covered; wetlands, croplands, grasslands, fire
  management, pest control, water rights, and wilderness and special areas are discussed.
  The wildlife section of the report discusses endangered and threatened species,
  waterfowl, migratory birds, marsh and water birds, shorebirds, raptors, game mammals,
  other resident wildlife, fishery resources, wildlife propagation and stocking, and
  marking and banding. Interpretation and recreation activities are outlined; topics
  include outdoor classrooms, information and interpretation, hunting, fishing, trapping,
  wildlife observation, camping, off-road vehicling, and law enforcement. The equipment
  and facilities section discusses new construction, rehabilitation, major maintenance,
  equipment utilization and replacement, and energy conservation. Items of interest,
  photographs, and Refuge brochures are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
